eld-top-res-480-value="210"	data-field-top-res-320-value="170"	data-field-left-value="456"	data-field-left-res-960-value="339"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570711762285' ><strong>Можжевельник</strong> - натуральный афродизиак, улучшает кровообращение, повышают потенцию, стимулирует работу желез внутренней секреции. Богат флавоноидами, фитонцидами, аскорбиновой кислотой, дубильными веществами, сахарами, органическими кислотами. Имеет сильные обезболивающие, расслабляющие, противовоспалительные свойства.<br></div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712040708' data-elem-id='1570712040708' data-elem-type='text'	data-field-top-value="300"	data-field-top-res-960-value="295"	data-field-top-res-640-value="625"	data-field-top-res-480-value="615"	data-field-top-res-320-value="560"	data-field-left-value="791"	data-field-left-res-960-value="690"	data-field-left-res-640-value="20"	data-field-left-res-480-value="30"	data-field-left-res-320-value="19"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712040708' ><strong>Панцерия</strong> включает в себя большое количество витамина С, антиоксидантов, обладает антибактериальными свойствами, что предотвращает воспаление половых органов. Применяется при аденоме предстательной железы.<br></div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712188628' data-elem-id='1570712188628' data-elem-type='text'	data-field-top-value="675"	data-field-top-res-960-value="686"	data-field-top-res-640-value="625"	data-field-top-res-480-value="615"	data-field-top-res-320-value="560"	data-field-left-value="116"	data-field-left-res-960-value="-12"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712188628' ><strong>Маклюра</strong> обладает бактерицидным действием, способствует заживлению ран, оказывает противовоспалительный и обезболивающий эффект. Восстанавливает эластичность кавернозных тел, способствует их быстрому наполнению кровью и возникновению эрекции.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712428067' data-elem-id='1570712428067' data-elem-type='text'	data-field-top-value="675"	data-field-top-res-960-value="686"	data-field-top-res-640-value="960"	data-field-top-res-480-value="941"	data-field-top-res-320-value="890"	data-field-left-value="455"	data-field-left-res-960-value="339"	data-field-left-res-640-value="20"	data-field-left-res-480-value="30"	data-field-left-res-320-value="19"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712428067' ><strong>Пихта</strong> содержит бисаболен, камфору, терпены, фитонциды. Действует как антисептическое, противовоспалительное, противоотечное средство, оказывает местный согревающий эффект, усиливает кровообращение в мелких сосудах, улучшает потенцию.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712525962' data-elem-id='1570712525962' data-elem-type='text'	data-field-top-value="675"	data-field-top-res-960-value="686"	data-field-top-res-640-value="960"	data-field-top-res-480-value="941"	data-field-top-res-320-value="890"	data-field-left-value="790"	data-field-left-res-960-value="690"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712525962' ><strong>Пчелиный воск -</strong> источник множества биоактивных соединений, обеззараживает, стимулирует заживление, уменьшает воспаление, оказывает согревающий эффект.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712639932' data-elem-id='1570712639932' data-elem-type='text'	data-field-top-value="991"	data-field-top-res-960-value="1010"	data-field-top-res-640-value="1270"	data-field-top-res-480-value="1245"	data-field-top-res-320-value="1175"	data-field-left-value="116"	data-field-left-res-960-value="-10"	data-field-left-res-640-value="20"	data-field-left-res-480-value="30"	data-field-left-res-320-value="19"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712639932' ><strong>Родила розовая</strong> - «золотой корень» включает в себя фруктовые кислоты, марганец, серебро, медь, фосфор, железо, хром, магний, дубильные вещества, стероиды, флавоноиды, кумарины. Регулирует обмен веществ, поднимает тонус и физическую выносливость, омолаживает.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712683954' data-elem-id='1570712683954' data-elem-type='text'	data-field-top-value="991"	data-field-top-res-960-value="1010"	data-field-top-res-640-value="1270"	data-field-top-res-480-value="1579"	data-field-top-res-320-value="1505"	data-field-left-value="455"	data-field-left-res-960-value="339"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712683954' ><strong>Красный корень</strong> - «мужик-корень» содержит витамин Р, аскорбиновую кислоту, флавоноиды и аминокислоты. Оказывает сильное капилляропротекторное, противовоспалительное, спазмолитическое и болеутоляющее действие, стимулирует ЦНС. Повышает потенцию, уменьшает застойные явления и активизирует кровообращение в органах малого таза.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712747346' data-elem-id='1570712747346' data-elem-type='text'	data-field-top-value="991"	data-field-top-res-960-value="1010"	data-field-top-res-640-value="1657"	data-field-top-res-480-value="1245"	data-field-top-res-320-value="1175"	data-field-left-value="790"	data-field-left-res-960-value="690"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-960-value="280"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712747346' ><strong>Солодка</strong> богата антиоксидантами, витаминами, органическими кислотами и другими биоактивными соединениями. Проявляет бактерицидное, противоотечное, спазмолитическое, разжижающее свойства, нормализует проницаемость сосудов. <br></div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712917083' data-elem-id='1570712917083' data-elem-type='text'	data-field-top-value="1367"	data-field-top-res-960-value="1395"	data-field-top-res-640-value="1657"	data-field-top-res-480-value="1579"	data-field-top-res-320-value="1505"	data-field-left-value="117"	data-field-left-res-960-value="-10"	data-field-left-res-640-value="20"	data-field-left-res-480-value="30"	data-field-left-res-320-value="19"	data-field-width-value="299"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712917083' ><strong>Элеутерококк</strong> содержит крахмал, гликозиды, пектины, дубильные вещества, минералы, антоциан, витамины. Сильный иммуномодулятор, стимулирует физическую и умственную активность, улучшает обмен веществ, повышает уровень гемоглобина в крови, снижает содержание сахара.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570712978874' data-elem-id='1570712978874' data-elem-type='text'	data-field-top-value="1367"	data-field-top-res-960-value="1395"	data-field-top-res-640-value="1960"	data-field-top-res-480-value="1975"	data-field-top-res-320-value="1870"	data-field-left-value="456"	data-field-left-res-960-value="339"	data-field-left-res-640-value="20"	data-field-left-res-480-value="30"	data-field-left-res-320-value="19"	data-field-width-value="299"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570712978874' ><strong>Аралия -</strong> в ее состав входят терпены, высшие органические кислоты, антоцианы, эфирные масла и витамины. Оказывает тонизирующее, противоопухолевое, противовоспалительное действие, помогает избавиться от хронической усталости.</div> </div> <div class='t396__elem tn-elem tn-elem__1321124961570713061291' data-elem-id='1570713061291' data-elem-type='text'	data-field-top-value="1367"	data-field-top-res-960-value="1395"	data-field-top-res-640-value="1960"	data-field-top-res-480-value="1975"	data-field-top-res-320-value="1870"	data-field-left-value="791"	data-field-left-res-960-value="690"	data-field-left-res-640-value="340"	data-field-left-res-480-value="270"	data-field-left-res-320-value="180"	data-field-width-value="299"	data-field-width-res-480-value="190"	data-field-width-res-320-value="120"	data-field-axisy-value="top"	data-field-axisx-value="left"	data-field-container-value="grid"	data-field-topunits-value=""	data-field-leftunits-value=""	data-field-heightunits-value=""	data-field-widthunits-value="" > <div class='tn-atom' field='tn_text_1570713061291' ><strong>Соцветия каштана</strong> включают эсцин, кумарины, витамины группы В, К, каротиноиды, рутин. Оказывают венопротекторное, венотонизирующее, противовоспалительное, антитромбическое действие. Улучшают микроциркуляцию, снижают вязкость крови и проницаемость капилляров.</div> </div> </div> </div> <script>$( document ).ready(function() { t396_init('132112496');
